fn swab64(val: u64) -> u64{
    return
        ( val >> 56) |
        ((val >> 40) & 0xff00) |
        ((val >> 24) & 0xff0000) |
        ((val >> 8)  & 0xff000000) |
        ((val << 8)  & 0xff00000000) |
        ((val << 24) & 0xff0000000000) |
        ((val << 40) & 0xff000000000000) |
        ((val << 56));
}

